import 'bootstrap/dist/css/bootstrap.min.css';

import Navigation from './components/Navigation'
import Signup from './components/Signup'

function App() {
  return (
    <div className="App">
      <Navigation />
      <Signup />
    </div>
  );
}

export default App;
